import React from "react";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";
import { Line } from "react-chartjs-2";
import faker from "faker";

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

export const options = {
  responsive: true,
  plugins: {
    legend: {
      position: "top",
    },
    title: {
      display: true,
      text: "Hourly forecast",
    },
  },
};



function Chart({newXAxisData, newYAxisData, dataa}) {
  console.log("dataaa", dataa.description)
  const desData = ["a", "b", "c", "e", "d", "f", "g"]
  const labels = newXAxisData;
  console.log("new x data ===",newXAxisData)
  console.log("new y data===",newYAxisData)
  const data = {
    labels,
    datasets: [
      {
        label: "Temperature",
        data: newYAxisData, desData,
        borderColor: "rgb(255, 99, 132)",
        backgroundColor: "rgba(255, 99, 132, 0.5)",
      },
    ],
  };
  return <Line options={options} data={data} />;
}



export default Chart;
